script: |
  super -f text -I q11388.spq | sort > q11388.out

inputs:
  - name: q11388.spq
    data: |
      SELECT DISTINCT col2 + - col0 AS col0 FROM tab0 (FORMAT parquet) WHERE ( - col2 ) NOT BETWEEN ( 79 ) AND 21;
  - name: tab0

outputs:
  - name: q11388.out
    data: |
      -77
      2
      32
